import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import axios from 'axios';

const Dashboard = () => {
  const [stats, setStats] = useState({
    totalMessages: 0,
    unreadMessages: 0,
    lastMessageDate: null
  });
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  // Fetch dashboard statistics
  useEffect(() => {
    const fetchDashboardStats = async () => {
      try {
        // Get the admin token from localStorage
        const token = localStorage.getItem('adminToken');

        // If no token, redirect to login
        if (!token) {
          navigate('/admin/login');
          return;
        }

        // Fetch dashboard stats with authorization header
        const response = await axios.get('/api/admin/dashboard-stats', {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        setStats(response.data);
        setIsLoading(false);
      } catch (err) {
        setError('Failed to fetch dashboard statistics');
        setIsLoading(false);

        // If unauthorized, redirect to login
        if (err.response?.status === 401) {
          navigate('/admin/login');
        }
      }
    };

    fetchDashboardStats();
  }, [navigate]);

  // Logout handler
  const handleLogout = () => {
    // Remove the admin token
    localStorage.removeItem('adminToken');
    // Redirect to login page
    navigate('/admin/login');
  };

  // Handle loading and error states
  if (isLoading) {
    return (
      <div className="min-h-screen flex items-center justify-center">
        <div className="text-xl">Loading dashboard...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="min-h-screen flex items-center justify-center">
        <div className="text-red-500">{error}</div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="container mx-auto">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-3xl font-bold text-gray-800">Admin Dashboard</h1>
          <button 
            onClick={handleLogout}
            className="bg-red-500 hover:bg-red-600 text-white font-bold py-2 px-4 rounded"
          >
            Logout
          </button>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          {/* Messages Card */}
          <div className="bg-white shadow-md rounded-lg p-6">
            <h2 className="text-xl font-semibold mb-4">Messages</h2>
            <div className="space-y-2">
              <p>Total Messages: <span className="font-bold">{stats.totalMessages}</span></p>
              <p>Unread Messages: <span className="font-bold text-red-500">{stats.unreadMessages}</span></p>
              {stats.lastMessageDate && (
                <p>Last Message: {new Date(stats.lastMessageDate).toLocaleString()}</p>
              )}
            </div>
            <Link 
              to="/admin/messages" 
              className="mt-4 block text-center bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded"
            >
              View Messages
            </Link>
          </div>

          {/* Additional Dashboard Widgets */}
          <div className="bg-white shadow-md rounded-lg p-6">
            <h2 className="text-xl font-semibold mb-4">Quick Actions</h2>
            <div className="space-y-4">
              <Link 
                to="/admin/messages" 
                className="block bg-green-500 hover:bg-green-600 text-white font-bold py-2 px-4 rounded text-center"
              >
                Manage Messages
              </Link>
              {/* Add more quick action buttons as needed */}
            </div>
          </div>

          <div className="bg-white shadow-md rounded-lg p-6">
            <h2 className="text-xl font-semibold mb-4">System Information</h2>
            <div className="space-y-2">
              <p>Last Login: {new Date().toLocaleString()}</p>
              {/* You can add more system info here */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
